import React from "react";
import ReactPaginate from "react-paginate";
import Movies from "./Movies";
import Search from "./Search";

const Home = () => {
     return (
          <>
               <Search />
               <Movies />
               <ReactPaginate
                    previousLabel={"<<"}
                    nextLabel={">>"}
                    breakLabel={"..."}
                    pageCount={6}
                    marginPagesDisplayed={3}
                    pageRangeDisplayed={6}
                    onPageChange={handlePageClick}
               />
          </>
     );
};

export default Home;
